import React, {FC} from 'react';


type PropsType = {
    title: string
    tasks: Array<PropsArrayType>
}

type PropsArrayType = {
    id: string
    title: string
    isDone: boolean
}


export const ToDoList: FC<PropsType> = (props) => {

    const tasks = props.tasks.map(t => {
        return (
            <li><input type="checkbox" checked={true}/><span>{}</span></li>
        )
    })


    return (
        <div>
            <h3>{props.title}</h3>
            <div>
                <input/>
                <button>+</button>
            </div>
            <ul>
                <li><input type="checkbox" checked={true}/><span></span></li>
                <li><input type="checkbox" checked={true}/> <span></span></li>
                <li><input type="checkbox" checked={false}/> <span></span></li>
            </ul>
            <div>
                <button>All</button>
                <button>Active</button>
                <button>Completed</button>
            </div>
        </div>
    );
};
